/* eslint-disable prettier/prettier */
import PhotoSlideshow from './PhotoSlideshow';
import IndexGrid from './styles/IndexGrid';
import IndexImage from './IndexImage';

export default function Products() {

  return (
      <IndexGrid>
        <div id="grid">
          <div id="slideshow">
            <PhotoSlideshow />
          </div>
          <div id="hoodies"><IndexImage catagory="hoodies"/></div>
          <div id="hoodies"><IndexImage catagory="shirts"/></div>
          <div id="hoodies"><IndexImage catagory="footwear" /></div>
          <div id="hoodies"><IndexImage catagory="kids"/></div>
          <div id="hoodies"><IndexImage catagory="dresses"/></div>
          <div id="hoodies"><IndexImage catagory="hoodies"/></div>
          <div id="hoodies"><IndexImage catagory="hoodies"/></div>
          
          
          
          
          <IndexImage catagory="female"/>
          <IndexImage catagory="male"/>
          <IndexImage catagory="accessories"/>
        </div>
      </IndexGrid>
  );
}
